    VS = contextGL.createShader(contextGL.VERTEX_SHADER);
    FS = contextGL.createShader(contextGL.FRAGMENT_SHADER);
    contextGL.shaderSource(VS, "attribute vec2 aPosition;" + "attribute vec2 aTexCoord;" + "uniform vec2 uPos;" + "uniform vec2 uScale;" + "uniform vec4 uColor;" + "uniform vec2 uTexPos;" + "uniform vec2 uTexSize;" + "uniform vec2 uDisplaySize;" + "uniform vec4 uColorRight;" + "uniform vec4 uColorDown;" + "uniform float uRotate;" + "varying vec4 vColor;" + "varying vec2 vTexCoord;" + "void main(void) {" + "vColor = uColor;" + "vColor += (uColorRight- uColor) * aPosition.x;" + "vColor += (uColorDown - uColor)* aPosition.y;" + "vTexCoord = vec2(" + "aTexCoord.x * uTexSize.x + uTexPos.x," + "aTexCoord.y * uTexSize.y + uTexPos.y" + ");" + "vec2 pos = aPosition.xy;" + "pos.x -= 0.5;" + "pos.y -= 0.5;" + "vec2 rPos = vec2(" + "pos.x * cos(uRotate) - pos.y * sin(uRotate)," + "pos.x * sin(uRotate) + pos.y * cos(uRotate)" + ");" + "rPos.x += 0.5;" + "rPos.y += 0.5;" + "gl_Position = vec4(" + "-1.0 + (rPos.x * (uScale.x / uDisplaySize.x) * 2.0) + (uPos.x / uDisplaySize.x * 2.0)," + "1.0 - (rPos.y * (uScale.y / uDisplaySize.y) * 2.0) - (uPos.y / uDisplaySize.y * 2.0)," + "0.0,1.0" + ");" + "}");
    contextGL.compileShader(VS);
    if (!contextGL.getShaderParameter(VS, contextGL.COMPILE_STATUS)) {
        alert(contextGL.getShaderInfoLog(VS))
    }
    contextGL.shaderSource(FS, "precision mediump float;" + "uniform sampler2D texture;" + "varying vec4 vColor;" + "varying vec2 vTexCoord;" + "void main(void){" + "vec4 smpColor = texture2D(texture, vTexCoord);" + "gl_FragColor  = vColor * smpColor;" + "}");
    contextGL.compileShader(FS);
