    attLocation[1] = contextGL.getAttribLocation(shaderSprite, "aTexCoord");
    attStride[0] = 2;
    attStride[1] = 2;
    uniLocatPos = contextGL.getUniformLocation(shaderSprite, "uPos");
    uniLocatScale = contextGL.getUniformLocation(shaderSprite, "uScale");
    uniLocatColor = contextGL.getUniformLocation(shaderSprite, "uColor");
    uniLocatTexPos = contextGL.getUniformLocation(shaderSprite, "uTexPos");
