var masterVolumeFade = 0;
masterVolumeUpdate = function() {
    if (Math.abs(masterVolumeCur - masterVolume) > Math.abs(masterVolumeFade)) {
        if (scenario.isSkip) {
            masterVolumeCur -= masterVolumeFade * skipSpeed
        } else {
            masterVolumeCur -= masterVolumeFade
        }
        if (masterVolumeFade > 0 && masterVolumeCur < masterVolume) {
            masterVolumeCur = masterVolume
        } else if (masterVolumeFade < 0 && masterVolumeCur > masterVolume) {
            masterVolumeCur = masterVolume
        }
    }
}
