setMasterVolume = function(vol, frame) {
    if (frame <= 1) {
        masterVolumeFade = 0;
        masterVolume = masterVolumeCur = vol
    } else {
        masterVolumeFade = (masterVolume - vol) / frame;
        masterVolume = vol
    }
}
