Scene.prototype.update = function() {
    if (isPause) {
        return
    }
    if (isSceneLoad) {
        if (this.player.isEnd) {
            this.player.time += deltaTime
        }
        return
    }
    var oldFrame = this.player.frame;
    var movieFrame = parseInt(this.player.currentTime * 30);
    if (!(scenario.sceneIndex == 1 || scenario.sceneIndex == 999)) {
        if (this.player.frame <= movieFrame) {
            this.player.frame += 1
        }
    } else {
        this.player.time += deltaTime;
        if (this.player.frame <= movieFrame) {
            this.player.frame += 1
        }
    }
    if (this.loopTime && this.loopTime <= this.player.frame && this.loopTime - 1 >= oldFrame) {
        this.player.isEnd = true
    }
    if (oldFrame <= this.player.frame && this.audioSchedule) {
        for (i = oldFrame; i < this.player.frame; i++) {
            while (this.audioSchedule[this.audioScheduleCnt] && this.audioSchedule[this.audioScheduleCnt].f == i) {
                this.audioSchedule[this.audioScheduleCnt].func(this.audioSchedule[this.audioScheduleCnt]);
                this.audioScheduleCnt += 1
            }
        }
    }
    if (this.player.isEnd && (!this.audioSchedule || !this.audioSchedule[this.audioScheduleCnt] || this.endStart)) {
        if (!this.isEnd && scenario.sceneIndex > 3) {
            BBWebStorage.save()
        }
        this.isEnd = true
    }
}
;
Scene.prototype.play = function(data, endStart, nextScene) {
    var url = "./movie/" + data.path;
    var loop = data.loop;
    this.endStart = endStart;
    this.audioSchedule = data.sch;
    var self = this;
    this.player.ontimeupdate = function() {
        if (currentScene) {
            currentScene.player.stop();
            currentScene.player.onended = null ;
            if (isMobile || window.navigator.userAgent.indexOf("iPad") > -1) {
                currentScene.player.nextLoaded = false
            } else {
                if (nextScene) {
                    currentScene.player.src = "./movie/" + nextScene.path;
                    currentScene.player.load();
                    currentScene.player.nextLoaded = true
                            
                } else {
                    currentScene.player.nextLoaded = false
                }
            }
        }
        currentScene = self;
        if (endStart) {
            var du = loop / 30 || this.duration - 1;
            this.fastSeek(du);
            this.isEnd = true
        } else {
            isSceneLoad = false
        }
        this.time = this.currentTime * 30;
        // this.ontimeupdate = null ;
        this.ontimeupdate = function () {
            if (currentScene && currentScene.player)
                $.get(currentScene.player.src + ".srt",
                    function (data) {
                        var captions = new Subtitle();
                        captions.parse(data);
                        var subtitles = captions.getSubtitles();
                        var result = ""
                        for (var i = 0; i < subtitles.length; i++) {
                            if (currentScene.player.currentTime * 1000 > Subtitle.toMS(subtitles[i].start) && currentScene.player.currentTime * 1000 < Subtitle.toMS(subtitles[i].end))
                                result = subtitles[i].text;
                        }
                        document.getElementById("Caption").innerHTML = result;
                    }) 
        };
        
        self = null 
    }
    ;
    this.player.onended = function() {
        if (loop != undefined) {
            this.fastSeek(loop / 30);
            this.time = loop;
            this.frame = loop;
            this.play()
        } else if (!isSceneLoad) {
            this.isEnd = true;
            this.onended = null 
        }
        if (endStart) {
            isSceneLoad = false;
            this.frame = parseInt(this.currentTime * 30) + 1
        }
    }
    ;
    if (!this.player.nextLoaded) {
        this.player.src = url;
    }
    this.player.muted = true;
    isSceneLoad = true;
    sceneLoadTime = 0;
    this.loopTime = loop;
    this.isEnd = this.player.isEnd = false;
    this.player.frame = 0;
    this.player.time = 0;
    this.audioScheduleCnt = 0;
    BBWebLog("Play Movie " + url);
    this.player.play()
}
