Scenario.prototype.playNextScenario = function(forcNext) {
    if (currentScene) {
        currentScene.isEnd = false
    }
    var next;
    if (forcNext != undefined) {
        next = parseInt(forcNext);
        sceneA.player.nextLoaded = false;
        sceneB.player.nextLoaded = false
    } else if (scenePaths[this.sceneIndex].next) {
        next = scenePaths[this.sceneIndex].next
    } else {
        next = this.sceneIndex + 1
    }
    if (next == this.sceneIndex) {
        return
    }
    if (next == 126) {
        ga("send", "event", " trial_wroom", "click")
    } else if (next == 700) {
        ga("send", "event", " trial_qstart", "click")
    } else if (next == 951 || next == 952) {
        ga("send", "event", "trial_clear", "click")
    }
    switch (this.sceneType) {
    case eSceneType.talk:
    case eSceneType.effect:
        break;
    case eSceneType.select:
        next = scenePaths[this.sceneIndex].selJump[this.choiceSelect];
        if (this.selectAlreadyRead) {
            if (this.selectAlreadyRead.indexOf(next) < 0) {
                this.selectAlreadyRead[this.selectAlreadyRead.length] = next
            }
        } else {
            this.selectAlreadyRead = new Array;
            this.selectAlreadyRead[0] = next
        }
        break;
    case eSceneType.alreadyRead:
        var reqTrue = true;
        for (var i = 0; i < scenePaths[this.sceneIndex].req.length; i++) {
            if (this.selectAlreadyRead.indexOf(scenePaths[this.sceneIndex].req[i]) < 0) {
                reqTrue = false;
                break
            }
        }
        if (reqTrue) {
            next = scenePaths[this.sceneIndex].trueRoot
        }
        break;
    case eSceneType.exam:
        if (this.examNext == eExamNextType.tuki) {
            this.currentTestimonyScene = scenePaths[this.sceneIndex].failRe || this.sceneIndex;
            if (this.selectEvidence == scenePaths[this.sceneIndex].ansEvi) {
                next = scenePaths[this.sceneIndex].tukiJump
            } else {
                next = this.tukiFailure[Math.floor(Math.random() * 3)]
            }
        } else {
            var nextTes = [scenePaths[this.sceneIndex].prev, scenePaths[this.sceneIndex].next, scenePaths[this.sceneIndex].yusaJump];
            next = parseInt(forcNext) || nextTes[this.examNext]
        }
        if (scenePaths[this.sceneIndex].end && this.examNext == eExamNextType.next) {}
        if (this.examNext == eExamNextType.yusa) {}
        break;
    case eSceneType.tukiFail:
        next = this.currentTestimonyScene;
        break
    }
    currentScene.player.onended = null ;
    this.play(false, next)
}
;
Scenario.prototype.play = function(endStart, index) {
    if (index != undefined) {
        this.sceneIndex = index
    }
    BBWebLog("Scene " + this.sceneIndex.toString(), "color: blue");
    var nextPreload = null ;
    if (scenePaths[this.sceneIndex].type != eSceneType.select && scenePaths[this.sceneIndex].type != eSceneType.alreadyRead && scenePaths[this.sceneIndex].type != eSceneType.exam && scenePaths[this.sceneIndex].type != eSceneType.tukiFail) {
        var next;
        if (scenePaths[this.sceneIndex].next) {
            next = scenePaths[this.sceneIndex].next
        } else {
            next = this.sceneIndex + 1
        }
        nextPreload = scenePaths[next]
    }
    if (currentScene != sceneA || !currentScene) {
        sceneA.play(scenePaths[this.sceneIndex], endStart, nextPreload)
    } else {
        sceneB.play(scenePaths[this.sceneIndex], endStart, nextPreload)
    }
    this.sceneType = scenePaths[this.sceneIndex].type || eSceneType.talk;
    if (scenePaths[this.sceneIndex].onCourtRecord) {
        this.isCourtRecord = true;
        subPanelCtrl.buttonTR.state = eButtonState.fadein;
        subPanelCtrl.buttonTR.fontMessage = "法廷記録";
        subPanelCtrl.buttonTR.fontOffset = [-74, 10];
        subPanelCtrl.buttonTR.setSE(eSe.window_close)
    }
    if (scenePaths[this.sceneIndex].tesNum) {
        this.evidenceNum = scenePaths[this.sceneIndex].tesNum
    }
    if (scenePaths[this.sceneIndex].prNum) {
        this.profileNum = scenePaths[this.sceneIndex].prNum
    }
    this.isNoSkip = scenePaths[this.sceneIndex].noSkip;
    this.isTestimony = scenePaths[this.sceneIndex].isTestimony;
    if (this.sceneType == eSceneType.effect) {
        subPanelCtrl.setState(eSubPanelState.talk0)
    }
    if (this.sceneType == eSceneType.select) {
        subPanelCtrl.choice.button[0].message = scenePaths[this.sceneIndex].selText[0];
        subPanelCtrl.choice.button[1].message = scenePaths[this.sceneIndex].selText[1];
        subPanelCtrl.choice.button[2].message = scenePaths[this.sceneIndex].selText[2]
    }
    if (this.sceneType == eSceneType.exam) {
        this.testimonyNum = scenePaths[this.sceneIndex].teNum;
        this.isEnd = scenePaths[this.sceneIndex].end
    }
    if (scenePaths[this.sceneIndex].failure) {
        this.tukiFailure = scenePaths[this.sceneIndex].failure
    }
    if (this.sceneType == eSceneType.tukiFail) {}
    if (scenePaths[this.sceneIndex].movieEnd) {
        BBWebStorage.delete();
        subPanelCtrl.setState(eSubPanelState.end);
        if (this.sceneIndex == 999) {
            ga("send", "event", "trial_sizzle", "click")
        }
    }
}
