EvidenceUpper.prototype.draw = function(context) {
    var fade = 0;
    if (this.isActive) {
        this.fadeTime += deltaTime
    } else {
        this.fadeTime -= deltaTime
    }
    this.fadeTime = Math.min(Math.max(this.fadeTime, 0), 12);
    if (this.fadeTime <= 6) {
        fade = this.fadeTime / 6
    } else {
        fade = 2 - this.fadeTime / 6
    }
    if (fade <= 0 && !this.isActive) {
        return
    }
    fade = Math.max(0, fade);
    if (this.fadeTime > 6) {
        contextUpper.fillRect(0, 0, 400 * displayResolution, 240 * displayResolution);
        context.save();
        context.scale(1, 1);
        context.fillStyle = "rgba(255,255,255,1)";
        appDrawImage(context, this.img, this.left, this.top, this.right, this.bottom, 0, 0, 400, 240);
        context.restore()
    }
    context.fillStyle = "rgba(0,0,0," + fade.toString() + ")";
    context.fillRect(0, 0, 400 * displayResolution, 240 * displayResolution);
    context.fillStyle = "rgba(0,0,0,0)"
}
