inherits(Button, GLSprite);
Button.prototype.updateInput = function() {
    this.isDecide = false;
    if (this.buttonPushWait > 0) {
        this.buttonPushWait -= deltaTime;
        if (this.buttonPushWait <= 0) {
            this.buttonPushWait = 0;
            this.offsetY = 0;
            this.isHold = false;
            this.isDecide = true;
            this.isTutorial = false
        }
        return
    }
    switch (this.state) {
    case eButtonState.out:
        this.offsetY = this.UVSizeY;
        this.isTutorialTime = 0;
        break;
    case eButtonState.fadein:
        this.offsetY -= this.UVSizeY / 4 * deltaTime;
        if (this.offsetY < 0) {
            this.offsetY = 0;
            this.state = eButtonState.wait;
            this.isTutorialTime = 0
        }
        break;
    case eButtonState.wait:
        break;
    case eButtonState.fadeout:
        this.offsetY += this.UVSizeY / 4 * deltaTime;
        if (this.offsetY >= this.UVSizeY) {
            this.offsetY = this.UVSizeY;
            this.state = eButtonState.out
        }
        break
    }
    if (this.state != eButtonState.wait || subPanelCtrl.guiState != eGUIState.wait || currentScene && !currentScene.isEnd) {
        this.isHold = false;
        return
    }
    var x = touchPosX;
    var y = touchPosY;
    var absX = this.posX;
    var absY = this.posY;
    var minX = Math.min(absX, absX + this.UVSizeX * this.scaleX);
    var maxX = Math.max(absX, absX + this.UVSizeX * this.scaleX);
    var minY;
    var maxY;
    if (this.scaleY > 0) {
        minY = Math.min(absY, absY + this.UVSizeY * this.scaleY);
        maxY = Math.max(absY, absY + this.UVSizeY * this.scaleY * .9)
    } else {
        minY = Math.min(absY, absY + this.UVSizeY * this.scaleY * .6);
        maxY = Math.max(absY, absY + this.UVSizeY * this.scaleY)
    }
    if (this.spriteType == spriteVertDiv) {
        minX += 16;
        maxX -= 2;
        maxY += 8
    }
    if (this.spriteType == spriteVertDiv) {
        minX -= this.UVSizeX
    }
    if (x >= minX && x <= maxX && y >= minY && y <= maxY) {
        $("#lower").css("cursor", "pointer")
    }
    if (this.isHold && (isRelease() || isPadButton(this.button0))) {
        if (this.seNum) {
            se[this.seNum].play()
        }
        this.buttonPushWait = 3;
        setControlPossible(false);
        return
    }
    if (x >= minX && x <= maxX && y >= minY && y <= maxY && (isTrigger() || this.isHold) || isPadTrigger(this.button0)) {
        this.isHold = true;
        this.offsetY = -2 * this.scaleY
    } else {
        this.offsetY = 0;
        this.isHold = false
    }
}
