Button.prototype.draw = function() {
    if (!this.isDraw || this.state == eButtonState.out) {
        return
    }
    setTexture(this.graphic.tex);
    var oY = this.scaleY * -this.offsetY;
    if (this.isHold) {
        this.holdEffect.setPos(this.posX, this.posY + oY)
    } else {
        this.holdEffect.setPos(this.posX, this.posY + oY + 2)
    }
    this.holdEffect.setScale(this.scaleX, this.scaleY);
    this.holdEffect.setBaseColor([48, 43, 0, 1]);
    this.holdEffect.spriteType = this.spriteType;
    this.holdEffect.draw();
    setGLSpriteParam([this.posX, this.posY + oY], [this.UVSizeX * this.scaleX, this.UVSizeY * this.scaleY], [this.UVLeft / this.graphic.img.width, this.UVTop / this.graphic.img.height], [this.UVSizeX / this.graphic.img.width, this.UVSizeY / this.graphic.img.height]);
    drawSprite(this.spriteType);
    if (this.isTutorial) {
        this.isTutorialTime += deltaTime;
        var tuAlp = 0;
        if (this.isTutorialTime < 20) {
            tuAlp = this.isTutorialTime / 20
        } else if (this.isTutorialTime < 40) {
            tuAlp = 1 - (this.isTutorialTime - 20) / 20
        } else {
            this.isTutorialTime = 0
        }
        this.holdEffect.setPos(this.posX, this.posY + oY);
        this.holdEffect.setScale(this.scaleX, this.scaleY);
        this.holdEffect.setBaseColor([255, 255, 255, 128 * tuAlp]);
        this.holdEffect.draw();
        setGLBlendState(eBlendState.alpha)
    }
    if (this.isHold) {
        setGLBlendState(eBlendState.add);
        if (this.spriteType == spriteVertDiv) {
            this.holdEffect.setPos(this.posX - 9, this.posY + oY);
            this.holdEffect.setScale(this.scaleX * .875, this.scaleY * .75)
        } else {
            this.holdEffect.setPos(this.posX, this.posY + oY)
            ;
            this.holdEffect.setScale(this.scaleX * .91, this.scaleY * .8)
        }
        this.holdEffect.setBaseColor([30, 113, 139, 74]);
        this.holdEffect.draw();
        setGLBlendState(eBlendState.alpha)
    }
    if (font01.isLoaded()) {
        font01.glDraw(this.fontMessage, this.posX + this.fontOffset[0], this.posY + oY + this.fontOffset[1], [250, 244, 208, 255])
    }
}
