SubPanelCtrl.prototype.stateExamTalk = function() {
    switch (this.guiState) {
    case eGUIState.fadein:
        this.buttonTL.state = eButtonState.fadein;
        this.buttonTR.state = eButtonState.fadein;
        this.buttonTR.fontMessage = "つきつける";
        this.buttonTR.fontOffset = [-80, 10];
        this.buttonTC.state = eButtonState.out;
        this.buttonBL.state = eButtonState.out;
        this.buttonBR.state = eButtonState.out;
        this.pageClear.fadeState = eButtonState.out;
        this.pageClearExamLeft.state = eButtonState.fadein;
        this.pageClearExamRight.state = eButtonState.fadein;
        this.guiState = eGUIState.wait;
        break;
    case eGUIState.wait:
        this.pageClearExamLeft.isActive = currentScene && currentScene.isEnd;
        this.pageClearExamRight.isActive = currentScene && currentScene.isEnd;
        if (scenario.testimonyNum <= 0) {
            this.pageClearExamLeft.isActive = false
        }
        this.pageClearExamRight.isEnd = scenario.isEnd;
        if (this.buttonTL.isDecide) {
            scenario.examNext = eExamNextType.yusa;
            scenario.playNextScenario();
            this.setState(eSubPanelState.talk1);
            this.pageClearExamLeft.isActive = false;
            this.pageClearExamRight.isActive = false
        }
        if (this.buttonTR.isDecide) {
            this.setState(eSubPanelState.examTuki);
            this.courtRecord.selectNum = 1;
            this.pageClearExamLeft.isActive = false;
            this.pageClearExamRight.isActive = false
        }
        if (this.pageClearExamLeft.isHit && this.pageClearExamLeft.isActive || keys[eKeyCord.left]) {
            scenario.examNext = eExamNextType.prev;
            scenario.playNextScenario();
            se[eSe.kettei].play()
        }
        if (this.pageClearExamRight.isHit && this.pageClearExamRight.isActive || keys[eKeyCord.right]) {
            scenario.examNext = eExamNextType.next;
            if (scenario.isEnd) {
                this.setState(eSubPanelState.talk1);
                this.pageClearExamLeft.isActive = false;
                this.pageClearExamRight.isActive = false
            }
            scenario.playNextScenario();
            se[eSe.kettei].play()
        }
        break;
    case eGUIState.fadeout:
        if (this.buttonTR.state == eButtonState.wait) {
            this.buttonTL.state = eButtonState.fadeout;
            this.buttonTR.state = eButtonState.fadeout;
            this.pageClear.state = eButtonState.fadeout;
            this.pageClearExamLeft.state = eButtonState.fadeout;
            this.pageClearExamRight.state = eButtonState.fadeout
        }
        if (this.buttonTR.state == eButtonState.out) {
            this.switchState()
        }
        break
    }
}
;
SubPanelCtrl.prototype.stateExamTuki = function() {
    switch (this.guiState) {
    case eGUIState.fadein:
        this.buttonBL.state = eButtonState.fadein;
        this.buttonTC.state = eButtonState.fadein;
        this.buttonBR.state = eButtonState.out;
        this.buttonTL.state = eButtonState.out;
        this.courtRecord.fadeState = eButtonState.fadein;
        this.guiState = eGUIState.wait;
        break;
    case eGUIState.wait:
        if (this.buttonTC.isDecide) {
            scenario.examNext = eExamNextType.tuki;
            scenario.selectEvidence = this.courtRecord.selectNum;
            scenario.playNextScenario();
            this.setState(eSubPanelState.talk1)
        }
        if (this.buttonBL.isDecide) {
            this.setState(eSubPanelState.examTalk)
        }
        break;
    case eGUIState.fadeout:
        if (this.courtRecord.fadeState == eButtonState.wait) {
            this.buttonBR.state = eButtonState.fadeout;
            this.buttonTC.state = eButtonState.fadeout;
            this.courtRecord.fadeState = eButtonState.fadeout;
            if (this.nextState == eSubPanelState.examTalk) {
                this.buttonBL.state = eButtonState.fadeout
            }
        }
        if (this.courtRecord.fadeState == eButtonState.out) {
            this.switchState()
        }
        break
    }
}
