SubPanelCtrl.prototype.stateSelect = function() {
    switch (this.guiState) {
    case eGUIState.fadein:
        this.buttonTR.state = eButtonState.fadein;
        this.buttonTR.fontMessage = "法廷記録";
        this.buttonTR.fontOffset = [-74, 10];
        this.buttonTL.state = eButtonState.out;
        this.buttonTC.state = eButtonState.out;
        this.buttonBL.state = eButtonState.out;
        this.buttonBR.state = eButtonState.out;
        if (this.oldState == eSubPanelState.talk1) {
            this.choice.init()
        } else {
            this.choice.fadein()
        }
        this.guiState = eGUIState.wait;
        break;
    case eGUIState.wait:
        if (this.buttonTR.isDecide) {
            this.setState(eSubPanelState.courtRecord);
            this.courtRecord.selectNum = 1
        }
        if (this.choice.isDecide()) {
            this.setState(eSubPanelState.talk1)
        }
        break;
    case eGUIState.fadeout:
        if (this.frame > 4 && this.choice.isWait()) {
            if (this.nextState != eSubPanelState.talk1) {
                this.choice.fadeout()
            } else {
                this.buttonTR.state = eButtonState.fadeout
            }
        }
        if (this.choice.isOut()) {
            if (this.nextState == eSubPanelState.talk1) {
                scenario.playNextScenario()
            }
            this.switchState()
        }
        break
    }
}
