SubPanelCtrl.prototype.draw = function(context) {
    if (!this.isDraw) {
        return
    }
    this.wallpaper.draw(context);
    this.courtRecord.draw();
    this.textcut.draw();
    this.eventcut.draw();
    this.wallpaperFrame.draw(context);
    this.buttonTL.draw();
    this.buttonTC.draw();
    this.buttonTR.draw();
    this.buttonBL.draw();
    this.buttonBR.draw();
    this.pageClear.draw(context);
    this.pageClearExamLeft.draw();
    this.pageClearExamRight.draw();
    this.choice.draw();
    if (this.state == eSubPanelState.courtRecord) {
        var iconImg = graphic[eImage.panel];
        setTexture(iconImg.tex);
        var mode = this.courtRecord.mode == eCourtRecordMode.evidence ? 172 : 152;
        setGLSpriteParam([this.buttonTR.posX - 76, this.buttonTR.posY - this.buttonTR.offsetY + 6], [64, 20], [120 / iconImg.img.width, mode / iconImg.img.height], [64 / iconImg.img.width, 20 / iconImg.img.height]);
        drawSprite(spritePlane)
    }
    if (this.blackOut > 0) {
        if (!isSceneLoad) {
            this.blackOut -= deltaTime * 2
        }
        if (this.blackOuttitleFade < 0) {
            this.blackOut = 0
        }
        if (!this.isTutorialEnd) {
            setTexture(graphic[eImage.nullWhite].tex);
            setGLSpriteParam([0, 0], [320 * displayResolution, 240 * displayResolution], [0, 0], [1, 1], [0, 0, 0, this.blackOut / 30 * 255]);
            drawSprite(spritePlane)
        }
        contextUpper.fillStyle = "rgba(0,0,0," + (this.blackOut / 30).toString() + ")";
        contextUpper.fillRect(0, 0, 400 * displayResolution, 240 * displayResolution);
        contextUpper.fillStyle = "rgba(0,0,0,0)"
    }
    if (this.state == eSubPanelState.end) {
        setTexture(graphic[eImage.nullWhite].tex);
        setGLSpriteParam([0, 0], [320 * displayResolution, 240 * displayResolution], [0, 0], [1, 1], [0, 0, 0, this.frame / 120 * 255]);
        drawSprite(spritePlane);
        if (!isSceneLoad && currentScene.player.isEnd) {
            this.endPanel += deltaTime;
            var al = Math.min(this.endPanel / 60, 1);
            contextUpper.globalAlpha = al;
            appDrawImage(contextUpper, graphic[eImage.thankU].img, 0, 0, 400, 240, 0, 0, 400, 240);
            setTexture(graphic[eImage.thankL].tex);
            setGLSpriteParam([0, 0], [320, 240], [0, 0], [320 / 512, 240 / 256], [255, 255, 255, al * 255]);
            drawSprite(spritePlane);
            if (isClick && this.endPanel / 60 >= 2) {
                location.reload()
            }
        }
    }
}
