TrialTitleMain.prototype.draw = function() {
    var back = graphic[eImage.title_back];
    contextUpper.save();
    contextUpper.scale(1, 1);
    contextUpper.fillStyle = "rgba(255,255,255,1)";
    appDrawImage(contextUpper, back.img, 0, 0, 400, 240, 0, 0, 400, 240);
    contextUpper.restore();
    var logo = graphic[eImage.title_logo];
    var sca = 1;
    if (this.time < 4) {
        sca = 2 - this.time / 4 * 1.1
    } else if (this.time < 7) {
        sca = .9 + (this.time - 4) / 3 * .1
    }
    var alpha = 1;
    if (this.time < 7) {
        alpha = this.time / 7
    }
    contextUpper.save();
    contextUpper.translate(200, 101);
    contextUpper.scale(sca, sca);
    contextUpper.globalAlpha = alpha;
    appDrawImage(contextUpper, logo.img, 0, 180, 392, 180, -196, -90, 392, 180);
    appDrawImage(contextUpper, logo.img, 0, 0, 392, 180, -196, -90, 392, 180);
    contextUpper.restore();
    var trial = graphic[eImage.trial_logo];
    alpha = 0;
    if (this.time < 6) {
        alpha = 0
    } else if (this.time < 14) {
        sca = .4 + (this.time - 6) / 8 * .8;
        alpha = 1 - (this.time - 6) / 8;
        contextUpper.save();
        contextUpper.translate(177, 110);
        contextUpper.scale(sca, sca);
        contextUpper.globalAlpha = alpha;
        appDrawImage(contextUpper, trial.img, 0, 176, 152, 152, -76, -76, 152, 152);
        contextUpper.restore()
    }
    alpha = 1;
    if (this.time < 6) {
        alpha = 0
    } else if (this.time < 12) {
        alpha = (this.time - 6) / 6
    }
    contextUpper.save();
    contextUpper.scale(1, 1);
    contextUpper.translate(200, 196);
    contextUpper.globalAlpha = alpha;
    appDrawImage(contextUpper, trial.img, 384, 64, 84, 32, -42, -16, 84, 32);
    contextUpper.restore();
    alpha = 1;
    if (this.time < 10) {
        alpha = 0
    } else if (this.time < 30) {
        alpha = (this.time - 10) / 20
    }
    contextUpper.save();
    contextUpper.translate(200, 228);
    contextUpper.globalAlpha = alpha;
    appDrawImage(contextUpper, trial.img, 0, 156, 384, 20, -192, -10, 384, 20);
    contextUpper.restore();
    if (this.seCou < 1 && this.time >= 6) {
        this.seCou += 1;
        se[eSe.title_logo_st].play()
    }
    this.time += deltaTime
}
