function setVisibilityEvent() {
    var hidden, visibilityChange;
    if (typeof document.hidden !== "undefined") {
        hidden = "hidden";
        visibilityChange = "visibilitychange"
    } else if (typeof document.mozHidden !== "undefined") {
        hidden = "mozHidden";
        visibilityChange = "mozvisibilitychange"
    } else if (typeof document.msHidden !== "undefined") {
        hidden = "msHidden";
        visibilityChange = "msvisibilitychange"
    } else if (typeof document.webkitHidden !== "undefined") {
        hidden = "webkitHidden";
        visibilityChange = "webkitvisibilitychange"
    }
    document.addEventListener(visibilityChange, function() {
        if (document.hidden) {
            reqHidden("visibilitychange")
        } else {
            reqShow("visibilitychange")
        }
    }, false)
}
function setPageTransitionListener() {
    window.addEventListener("pagehide", function() {
        reqHidden("pagehide")
    }, false);
    window.addEventListener("pageshow", function() {
        reqShow("pageshow")
    }, false)
}
function reqHidden(event) {
    for (var i = 0; i < audioBgmSlot.length; i++) {
        if (audioBgmSlot[i] && audioBgmSlot[i].state != eAudioState.fadeout) {
            audioBgmSlot[i].pause()
        }
    }
    for (var i = 0; i < audioSeSlot.length; i++) {
        if (audioSeSlot[i]) {
            audioSeSlot[i].pause()
        }
    }
    for (var i = audioBgmSlot.length - 1; i >= 0; i--) {
        if (audioBgmSlot[i] && audioBgmSlot[i].state == eAudioState.fadeout) {
            audioBgmSlot[i].stop()
        }
    }
    if (currentScene && !currentScene.player.isEnd) {
        currentScene.player.pause()
    }
    isPause = true
}
function reqShow(event) {
    for (var i = 0; i < audioBgmSlot.length; i++) {
        if (audioBgmSlot[i]) {
            audioBgmSlot[i].play()
        }
    }
    for (var i = 0; i < audioSePauseSlot.length; i++) {
        if (audioSePauseSlot[i]) {
            audioSePauseSlot[i].play()
        }
    }
    audioSePauseSlot.length = 0;
    if (currentScene && !currentScene.player.isEnd) {
        currentScene.player.play()
    }
}
